('2015', '2015-01-19', '130702', 1, '병원진료', '2015-01-26 10:51:52', '김성식 부장님 결재', '2015-01-29 10:08:03', '처리완료', '130702', '130702', '2015-01-19 13:20:00', NULL, '2015-01-19 13:38:00', '2015-01-19 18:14:00'),
('2015', '2015-01-13', '130901', 2, '정상적으로 6시이후 퇴근했으나 퇴근 지문을 찍지 못했던 것 같습니다. 앞으로 주의하겠습니다...이상입니다.', '2015-01-26 12:04:55', '2월부터는 출퇴근시 필히 입력바랍니다.', '2015-01-30 10:20:41', '처리완료', '130901', '130702', NULL, NULL, '2015-01-13 08:27:00', '2015-01-13 17:43:00'),
('2015', '2015-01-16', '150105', 3, '8시 이후 퇴근 시 퇴근 지문을 확인하지 않고 갔습니다. 죄송합니다... 앞으로 주의하도록 하겠습니다.. 이상입니다...', '2015-01-26 13:39:35', '이번건은 강정규책임님께 전해들은 내용이나, \n근태관리시스템 도입되는 초반에는 지문인식을 기초로 하여 야근수당을 책정하게 \n되었습니다. \n퇴근은 정상퇴근으로 처리하였습니다.', '2015-01-30 10:23:55', '처리완료', '150105', '130702', NULL, '2015-01-16 20:10:00', '2015-01-16 08:56:00', '2015-01-16 15:40:00'),
('2015', '2015-01-23', '110209', 4, '오후반차 사용', '2015-01-26 14:53:36', '휴가는 결제 처리후 반영 됩니다.', '2015-01-28 11:31:53', '처리완료', '110209', '110209', NULL, NULL, '2015-01-23 08:05:00', '2015-01-23 13:08:00'),
