('2015', '2015-01-16', '150105', 21, '억울합니다.', '2015-01-29 17:17:05', '억울한 마음 이해합니다만..이제부터 야근할때 꼭 지문찍고 퇴근해주세요.', '2015-01-30 10:45:28', '처리완료', '100501', '130702', NULL, '2015-01-16 21:00:00', '2015-01-16 08:56:00', '2015-01-16 15:40:00'),
('2015', '2015-01-22', '071001', 22, '수원출장 후 퇴근시간', '2015-01-29 17:53:22', '외근 후 야근을 한 경우, 외근 상신을 올려주시기 바랍니다.\n외근 상신 후 결재가 떨어지면 야근 적용이 가능합니다.\n', '2015-02-02 11:32:59', '처리완료', '071001', '130702', NULL, '2015-01-22 22:00:00', '2015-01-22 09:18:00', '2015-01-22 10:54:00'),
('2015', '2015-01-05', '100402', 23, '출근시간 수정요청드립니다.\n김성식부장님께 이야기한사항으로 \n1/5일에 세콤시간이 1시간뒤로 되어 있어서 9시3분 출근하였으나 10시 3분으로 기록되었습니다.', '2015-01-29 17:58:43', '수정 요청 시간으로 수정하였습니다.', '2015-01-30 10:18:49', '처리완료', '100402', '130702', '2015-01-05 09:03:00', NULL, '2015-01-05 10:03:00', '2015-01-05 18:03:00'),
('2015', '2015-01-19', '071001', 24, '정상퇴근했습니다. 반영해주시기 바랍니다. ', '2015-01-29 17:59:08', '반영하였습니다. 퇴근 시 유의 바랍니다.', '2015-01-30 10:49:34', '처리완료', '071001', '130702', NULL, '2015-01-19 18:00:00', '2015-01-19 09:16:00', '2015-01-19 15:59:00'),
('2015', '2015-01-02', '130401', 25, '휴일 연차 근태 등록하였습니다.\n(경영팀에서 나중에 등록하라고 하였음)', '2015-01-29 17:59:18', '1월 2일 근태는 ERP에 등록바랍니다.', '2015-01-30 10:18:06', '처리완료', '130401', '130702', NULL, NULL, NULL, NULL),
('2015', '2015-01-14', '100402', 26, '야근 B형으로 변경 부탁드립니다. \n시스템 오류 (강정규 책임님께 이야기 해놓은 사항입니다.)', '2015-01-29 18:00:18', '오류 확인 건으로 수정 될 예정입니다.\n', '2015-01-30 10:22:06', '처리완료', '100402', '130702', NULL, NULL, '2015-01-14 08:01:00', '2015-01-14 22:00:00'),
('2015', '2015-01-16', '071003', 27, '연차휴가 정상 신청해서 사용했습니다.', '2015-01-29 18:02:39', '날짜가 나와있지 않네요. 확인 바랍니다.\n1월 31일 까지는 기존과 같이 ERP에 등록을 꼭 해주셔야 합니다.', '2015-01-30 10:46:11', '처리완료', '071003', '130702', NULL, NULL, NULL, NULL),
('2015', '2015-01-16', '100105', 28, '야근타입이 24:00까지 근무했는데 B형으로 되어 있습니다.\nC형으로 정정부탁드립니다.', '2015-01-29 18:04:03', '오류 인지하고 있습니다. 이부분은 야근수당 C타입으로 반영하였습니다.\n시스템은 곧 수정될 예정이오니, 추후 확인 바랍니다.', '2015-01-30 10:47:06', '처리완료', '100105', '130702', NULL, NULL, '2015-01-16 08:16:00', '2015-01-17 00:00:00'),
('2015', '2015-01-16', '100105', 29, '야근타입이 24:00까지 근무했는데 B형으로 되어 있습니다.\nC형으로 정정부탁드립니다.', '2015-01-29 18:04:03', '동인건 접수완료 하였습니다.', '2015-01-30 10:47:23', '처리완료', '100105', '130702', NULL, NULL, '2015-01-16 08:16:00', '2015-01-17 00:00:00'),
('2015', '2015-01-20', '071003', 30, '병원 방문으로 인한 조퇴', '2015-01-29 18:04:47', '정상퇴근 처리 하였습니다.', '2015-01-30 10:54:23', '처리완료', '071003', '130702', NULL, NULL, '2015-01-20 08:21:00', '2015-01-20 17:43:00'),
('2015', '2015-01-27', '080802', 32, '갑작스런 외근으로 결제 상신이 늦어져 문제가 발생한듯 합니다.\n정상 출근 처리 바랍니다.', '2015-01-29 21:57:53', '외근으로 인한 정상출근 처리 하였습니다.', '2015-01-30 10:56:57', '처리완료', '080802', '130702', NULL, NULL, '2015-01-27 15:27:00', '2015-01-27 20:48:00'),
('2015', '2015-01-23', '070901', 33, '연차휴가임', '2015-01-30 11:39:47', '근태메일과 ERP 등록건으로 1월 연차휴가 확인 건입니다.\n2/1부터 연차휴가 및 외근은 상신해 주시기 바랍니다.', '2015-01-30 18:03:44', '처리완료', '070901', '130702', NULL, NULL, NULL, NULL),
('2015', '2015-01-02', '070901', 34, '미체크', '2015-01-30 11:48:36', '출입기록을 기준으로 출근(지문) 또는 출입(지문)의 첫 지문으로\n출근을 확인 합니다.', '2015-02-02 11:18:17', '처리완료', '070901', '130702', NULL, NULL, '2015-01-02 09:17:00', '2015-01-02 19:07:00'),
('2015', '2015-01-16', '070901', 35, '미체크', '2015-01-30 11:49:15', '퇴근 시 지문 입력 주의 요청 바랍니다.', '2015-02-02 17:07:54', '처리완료', '070901', '130702', NULL, NULL, '2015-01-16 08:37:00', '2015-01-16 14:34:00'),
('2015', '2015-01-07', '070901', 36, '수원 외근', '2015-01-30 12:00:09', '1월 외근건은 정상출퇴근으로 임의처리 하였습니다.\n2/1부터 연차휴가 및 외근은 상신해 주시기 바랍니다.', '2015-02-02 11:29:41', '처리완료', '070901', '130702', NULL, NULL, NULL, NULL),
