('2015', '2015-01-21', '070901', 38, '수원외근', '2015-01-30 12:00:27', '1월 수요일 수원회의 일정건은 추후 등록할 예정입니다.\n2/1부터 연차휴가 및 외근은 상신해 주시기 바랍니다.', '2015-01-30 18:05:13', '처리완료', '070901', '130702', NULL, NULL, NULL, NULL),
