('2015', '2015-02-05', '110901', 127, '전일 야근으로 익일 00:20분 넘어서 퇴근하였고,  집이 인천이라 출근 소요시간이 오래 걸려 11시 51분에 출근하였습니다.', '2015-02-11 07:54:53', '수원사업장 근태규정 공지(2/5) 전의 건으로 \n2/2~2/4 지각 3건을 삭제하였습니다.\n2/5 이후로 출근시간은 근태규정을 확인바랍니다.', '2015-02-12 16:58:48', '처리완료', '110901', '130702', NULL, NULL, '2015-02-05 11:51:48', '2015-02-05 21:30:16'),
('2015', '2015-02-06', '110901', 128, '퇴근시 퇴근 클릭후 퇴근 했으나 오류가 있었나 봅니다. \r\n인천행 통근 버스를 타고 퇴근 했고, 첫차가 18시 10분으로 최소한 그 시간 이후에 퇴근은 확실합니다. 추후에는 퇴근 적용 되었는지 확인하겠습니다.', '2015-02-11 07:57:40', '2015.2.12\n조응래 팀장님 문자로 답변 확인하였습니다.\n수정요청시간으로 수정하였습니다.', '2015-02-12 17:03:47', '처리완료', '110901', '130702', NULL, '2015-02-06 18:10:53', '2015-02-06 07:52:05', NULL),
