('2015', '2015-02-10', '120601', 130, '10일 퇴근을 저녁 11시(23시) 쯤에 하였는데 퇴근을 체크 못하였습니다.  죽전역 지하철 막타를 타기위해 급하기 버스 타러 나가다 보니 체크를 못하였습니다. 수정 부탁드리겠습니다.', '2015-02-11 09:50:40', '퇴근실수로 누락된 출퇴근 기록은 3월부터 수정이 어려우니 반드시 출퇴근 확인을 바랍니다.\n2015-02-13 조응래 팀장님 확인해 주셔서 요청하신 시간으로 변경하였습니다.', '2015-02-13 15:11:23', '처리완료', '120601', '130702', NULL, '2015-02-10 22:55:03', '2015-02-10 09:51:13', NULL),
