('2015', '2015-02-13', '140102', 167, '2015-02-13 10:00\r\n상기일시에 본사 출근(부사장님면담) 했습니다. 수정 부탁드립니다.\r\n\r\nR3 복귀시간은 2015-02-13 13:00경입니다.\r\n근태관리서버의 출근버튼 오류로 출근체크 늦어짐(15:30복구)', '2015-02-16 17:55:02', '코멘트 입력 시, 수정 요청 시간은 수정을 요청하는 시간으로 입력 바랍니다.\n\n요청하신 출근시간으로 변경하였습니다.', '2015-02-17 09:10:44', '처리완료', '140102', '130702', '2015-02-16 17:51:20', NULL, '2015-02-13 15:37:50', '2015-02-13 19:12:41'),
('2015', '2015-02-23', '100701', 168, '회의 참석으로 출근시간을 확인하지 못 함.', '2015-02-24 09:45:24', '.', '2015-02-24 13:46:38', '처리완료', '100701', '130702', '2015-02-23 09:30:17', NULL, '2015-02-23 14:21:46', '2015-02-23 19:19:53'),
('2015', '2015-02-23', '100701', 169, '출근과 동시에 RJIL 내부회의로 출근시간을 확인하지 못 하였고 이후 근태 생각을 하지 못 하여 출근시간이 비정상입니다.', '2015-02-24 10:13:17', '2015-03-02 조응래팀장님 문자회신으로 확인 건.\r\n정상처리 되었습니다.', '2015-03-02 10:13:30', '처리완료', '100701', '130702', '2015-02-23 09:30:57', NULL, '2015-02-23 14:21:46', '2015-02-23 19:19:53'),
('2015', '2015-02-24', '100701', 170, '실수로 퇴근시간을 체크하지 못 했습니다.', '2015-02-25 09:58:21', '2015-03-02 조응래팀장님 문자회신으로 확인 건.\r\n정상처리 되었습니다.', '2015-03-02 10:13:43', '처리완료', '100701', '130702', NULL, '2015-02-24 21:40:03', '2015-02-24 09:43:52', NULL),
('2015', '2015-02-23', '110201', 171, 'CORE S/W DPI 검증 제안서를 삼성 담당자와 전영호 상무랑 협의차 R3 방문하여 협의 진행하고 R3에서 18:16 퇴근하게 되었습니다.(퇴근 등록은 휴대폰으로 하였습니다)', '2015-02-25 12:32:03', '본 건은 요청하신대로 처리하겠습니다.\r\n추후 휴대폰 사용은 허용되지 않으니 참고하시기 바랍니다.', '2015-02-26 16:23:48', '처리완료', '110201', '130702', NULL, '2015-02-23 18:16:49', '2015-02-23 09:11:12', NULL),
('2015', '2015-02-12', '0140201', 172, '김정숙 책임 2/12 오후반차 결재 신청을 2/11 사전 신청하였으나 조응래수석이 2/12 결재하여 당일 결재 처리됨, 당일결재를 전일결재로 수정해주세요', '2015-02-25 16:40:05', '당일결재를 전일결재로 결재일자를 수정할 수 없습니다.\r\n해당 건은 오후반차로 오후반차 사용전에 결재가 이루어진 건으로,\r\n벌점 대상이 아닙니다.', '2015-02-26 15:13:06', '처리완료', '110201', '130702', NULL, NULL, '2015-02-12 07:40:39', '2015-02-12 12:00:08'),
('2015', '2015-02-25', '0130101', 173, '출근은 흥덕U타워 --> 퇴근 R3입니다. \r\n회의가 있어서 R3에 방문. 박상철 책임 PC로 퇴근 check함.', '2015-02-27 09:08:07', '정상처리 되었습니다.', '2015-02-27 09:27:10', '처리완료', '0130101', '130702', NULL, NULL, '2015-02-25 08:44:34', '2015-02-25 18:03:09'),
('2015', '2015-02-26', '100401', 174, '퇴근시 찍고가지 않았습니다.\r\n19시에 정상퇴근 하였습니다. 수정부탁드립니다.', '2015-02-27 10:33:05', '2015.3.3 김태중팀장님 메일수신 확인 _ \r\n정상처리 되었습니다.', '2015-03-03 16:14:38', '처리완료', '100401', '130702', NULL, '2015-02-26 19:03:10', '2015-02-26 08:50:15', '2015-02-26 17:30:04'),
('2015', '2015-02-26', '110201', 175, '협력사 전용 메일 시스템 설명회가 수원 삼성 R4에서 10시부터 진행되어 출입 신청등이 필요하여 08:56에 R4로 바로 출근하였습니다.  ', '2015-02-27 17:45:07', '정상처리 되었습니다.', '2015-03-02 09:15:10', '처리완료', '110201', '130702', '2015-02-26 08:56:52', NULL, NULL, '2015-02-26 18:39:53'),
('2015', '2015-02-28', '110901', 176, '출근 시간 등록을 늦게 했습니다. 퇴근시간은 클릭 했는데 안 남아 있네요. 28일 출퇴근 시간을 확인 할 수 있도록 업무 메일 발송 내역을 캡쳐해서 조응래 수석님께 보내 드렸습니다. \r\n', '2015-03-02 10:22:39', '조응래팀장님 확인건으로 정상처리 되었습니다.', '2015-03-02 17:36:52', '처리완료', '110901', '130702', '2015-02-28 09:50:07', '2015-02-28 17:50:28', '2015-02-28 16:18:15', NULL),
