('2015', '2015-03-03', '100107', 178, '2015/3/3 17:23\r\n근태시스템 로그인하여 퇴근버튼을 눌렀으나 ''퇴근 동록에 실패하였습니다.''라는 멘트 나오며 등록 안됨. 당시 출근도 마찬가지였으며 3/4일에 직원들에게 문의한 결과 당시 대다수 직원들이 동일한 현상 발생. \r\n근거자료를 남기기 위해 2015/3/3 17:25 조응래 수석님께 당시상황 기재하여 메일발송.\r\n2015/3/3 17:30\r\n퇴근 셔틀버스 타러가던 중 담당자(김은영씨)에게 유선상으로 보고하였으며 조치를 취했다고 전달받음.\r\n(이미 사무실에서 퇴근한 후라서 미등록.)\r\n17:40정도(유선보고 이후) ', '2015-03-04 17:22:51', '수정하였습니다.', '2015-04-01 09:51:17', '처리완료', '100107', '130702', NULL, '2015-03-03 17:25:19', '2015-03-03 08:21:27', NULL),
