('2015', '2015-03-06', '0130101', 180, '2015-03-06 19:44:06 시간으로 퇴근 결제가 되어 있습니다.\r\n프로그램 오류 인것 같습니다. 확인 바랍니다.', '2015-03-09 08:44:46', '정상적인 업무로 퇴근기록이 있을경우 정상 적용 됩니다.\r\n해당건은 정상적으로 처리되었습니다.', '2015-03-09 09:47:23', '처리완료', '0130101', '130702', NULL, NULL, '2015-03-06 08:35:00', NULL),
('2015', '2015-03-06', '130401', 181, '오후 반차 신청한 상태에서 12시25분 경 퇴근했는데 찍고 나가지 않아서 조퇴로 표시되었습니다. 퇴근시 잊어먹고 찍고 나가지 않은건 본인 실수이나 출근 기록 퇴근기록을 보시면 일찍 출근하여 항상 시간이후에 퇴근하였습니다. 재고해서 처리 부탁드립니다. ', '2015-03-09 11:21:46', '본인 실수로 인한 건은 수정되지 않습니다.', '2015-04-01 09:52:58', '처리완료', '130401', '130702', NULL, '2015-03-06 12:25:32', '2015-03-06 08:46:18', '2015-03-06 12:15:35'),
