('2015', '2015-04-03', '080802', 195, '본 건은 전날 새벽 2시 40분에 퇴근하여 11시까지 출근해야하는데 11:12에 출근하여 12분 지각인데요. 출근시간 설정이 한시간단위로 설정되다보니 2시에 퇴근하든 2시 59분에 퇴근하든 11시까지 출근해야합니다. 분 단위로 출근해야할 시간을 정하도록 건의드립니다.', '2015-04-07 10:05:32', '사장님께 건의해 보겠습니다.', '2015-04-08 09:15:58', '처리완료', '100501', '130702', NULL, NULL, '2015-04-03 11:12', '2015-04-03 22:47'),
('2015', '2015-04-06', '140604', 196, '클릭미스로 인하여 퇴근을 출근으로 잘못찍었습니다.\r\n죄송합니다.', '2015-04-07 15:57:22', '출입기록 확인하여 수정 요청 시간으로 수정하였습니다.\r\n출입기록 시, 좀 더 신경써주시기 바랍니다.', '2015-04-08 09:17:32', '처리완료', '140604', '130702', NULL, '2015-04-06 21:40', '2015-04-06 08:36', NULL),
('2015', '2015-04-10', '100402', 197, '병원 치료로 사전보고 후 조기퇴근하였으니 정상조치 바랍니다.', '2015-04-13 19:03:58', '해당건은 벌점 적용 없이 정상처리 하겠습니다.', '2015-04-14 12:02:02', '처리완료', '070901', '130702', NULL, NULL, '2015-04-10 08:32', '2015-04-10 16:38'),
('2015', '2015-04-15', '120801', 198, '어제 21시50분쯤 퇴근을 찍고 갔다고 생각되는데 금일 확인하니 퇴근처리가 안된것 같습니다. 죄송합니다.', '2015-04-16 15:24:30', '본인 실수로 인한 건은 수정되지 않습니다.', '2015-04-22 10:08:43', '처리완료', '120801', '130702', NULL, '2015-04-16 15:20', '2015-04-15 08:46', NULL),
('2015', '2015-04-10', '071101', 199, '정시에 퇴근 하였습니다만, 출입 도장안 찍었나 봅니다.', '2015-04-20 19:29:56', '본인 실수로 인한 건은 수정되지 않습니다.', '2015-04-22 10:08:24', '처리완료', '071101', '130702', NULL, '2015-04-10 18:00', '2015-04-10 08:56', '2015-04-10 15:32'),
('2015', '2015-04-20', '100501', 200, '출근길 지하철 5호선(강동->왕십리) 고장으로 15분 연착하여 지각했습니다. \r\n< 관련기사 >\r\nhttp://www.ytn.co.kr/_ln/0103_201504200957057280', '2015-04-21 11:29:19', '관련자료 확인하여, 정상처리 하였습니다.', '2015-04-22 10:07:36', '처리완료', '100501', '130702', '2015-04-21 09:00', NULL, '2015-04-20 09:01', '2015-04-20 18:29'),
('2015', '2015-04-20', '110201', 201, '김부장님 은영씨 4/19 이병시 수석 부친상으로 공적 외근입니다. 조퇴로 처리되어있네요. 확인부탁합니다.', '2015-04-21 17:38:37', '외근 건으로 확인되었습니다.', '2015-04-28 10:30:42', '처리완료', '110201', '130702', NULL, '2015-04-21 19:00', '2015-04-20 09:14', '2015-04-20 16:55'),
('2015', '2015-04-21', '120601', 202, '아침에 깜박하고 출석체크를 못하였습니다.\r\n오전반차 처리 하였습니다.', '2015-04-22 18:39:37', '4/21 오전반차 확인 되었습니다.', '2015-04-28 10:31:39', '처리완료', '120601', '130702', NULL, NULL, '2015-04-21 10:59', '2015-04-21 18:01'),
('2015', '2015-04-22', '0140201', 203, '개인 업무 처리 지연으로 오후 반차 신청하려 하였으나 외근이 필요한 상황이 발생하여 R3 방문(출근 등록이 곤란한 상황으로 출근 체크가 늦어 졌습니다.)', '2015-04-24 07:24:04', '확인하여 요청하신 시간으로 수정하였습니다.', '2015-04-28 10:29:33', '처리완료', '0140201', '130702', '2015-04-22 15:20', NULL, '2015-04-22 17:57', '2015-04-22 19:34'),
('2015', '2015-04-10', '071101', 204, '퇴근시 체크가 안된 것 같습니다.', '2015-04-27 11:53:59', '본인 실수로 인한 건은 수정되지 않습니다.', '2015-04-28 10:26:48', '처리완료', '071101', '130702', NULL, '2015-04-10 18:30', '2015-04-10 08:56', '2015-04-10 15:32'),
('2015', '2015-03-26', '071101', 205, '정시 퇴근 했습니다...', '2015-04-27 11:56:32', NULL, NULL, '접수중', '071101', NULL, NULL, '2015-03-26 18:56', '2015-03-26 08:58', '2015-03-26 13:00'),
('2015', '2015-03-27', '071101', 206, '정시 퇴근 했습니다.', '2015-04-27 11:57:17', NULL, NULL, '접수중', '071101', NULL, NULL, '2015-03-27 18:56', '2015-03-27 08:55', '2015-03-27 16:13');
